INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (2002, -470.0, 0.0, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 130401, "ナーナ", 2, 0.0, 1, 2, 4, "2024/03/15 15:00:00", 10015, "2024/06/22 14:59:59");
