INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (2002, -470.0, 0.0, "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 133301, "カリザ", 5, 9.638, 2, 3, 6, "2024/09/15 15:00:00", 10023, "2024/12/22 14:59:59");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES (2002, -470.0, 0.0, "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 133401, "ミーア", 2, 2.88, 1, 1, 6, "2024/09/15 15:00:00", 10024, "2024/12/22 14:59:59");
